// src/components/OngoingJobs.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const OngoingJobs = ({ profileFilter, paygradeFilter, timeFilter }) => {
  const [ongoingJobs, setOngoingJobs] = useState([]);

  useEffect(() => {
    // Fetch ongoing jobs with filters from the backend API
    axios.get(`/api/jobs?profile=${profileFilter}&paygrade=${paygradeFilter}&time=${timeFilter}`)
      .then(response => setOngoingJobs(response.data))
      .catch(error => console.error(error));
  }, [profileFilter, paygradeFilter, timeFilter]);

  return (
    <div>
      <h2>Ongoing Jobs</h2>
      <ul>
        {ongoingJobs.map(job => (
          <li key={job._id}>{job.title}</li>
        ))}
      </ul>
    </div>
  );
};

export default OngoingJobs;
